import React from "react";

const BatsmenAnalysis = ({ data, team1, team2 }) => {
  if (!data || data.length === 0) return null;

  // Sort batsmen by total runs
  const sortedBatsmen = [...data].sort((a, b) => b.totalRuns - a.totalRuns);

  return (
    <div className="space-y-6">
      <h3 className="text-xl font-bold text-gray-800">Top Batsmen Analysis</h3>

      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Rank
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Batsman
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Team
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Total Runs
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Matches
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Strike Rate
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Average
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {sortedBatsmen.slice(0, 5).map((player, index) => (
              <tr
                key={player._id}
                className={
                  player.battingTeam === team1 ? "bg-green-50" : "bg-purple-50"
                }
              >
                <td className="px-6 py-4 whitespace-nowrap text-sm">
                  {index + 1}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium">
                  {player.batsman}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm">
                  {player.battingTeam}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm font-bold">
                  {player.totalRuns}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm">
                  {player.matchesPlayed}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm">
                  {player.strikeRate.toFixed(2)}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm">
                  {(player.totalRuns / player.matchesPlayed).toFixed(2)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
        {[team1, team2].map((team) => {
          const teamBatsmen = sortedBatsmen.filter(
            (player) => player.battingTeam === team
          );
          const totalTeamRuns = teamBatsmen.reduce(
            (sum, player) => sum + player.totalRuns,
            0
          );

          return (
            <div
              key={team}
              className={`p-4 rounded-lg ${
                team === team1 ? "bg-green-50" : "bg-purple-50"
              }`}
            >
              <h4 className="font-semibold mb-2">{team} Run Distribution</h4>
              <div className="space-y-2">
                {teamBatsmen.slice(0, 3).map((player) => (
                  <div key={player._id} className="flex justify-between">
                    <span>{player.batsman}</span>
                    <span className="font-medium">
                      {((player.totalRuns / totalTeamRuns) * 100).toFixed(1)}%
                      of runs
                    </span>
                  </div>
                ))}
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default BatsmenAnalysis;
